import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import ListItem from "@material-ui/core/ListItem";
import Divider from "@material-ui/core/Divider";
import ListItemText from "@material-ui/core/ListItemText";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import Avatar from "@material-ui/core/Avatar";
import Typography from "@material-ui/core/Typography";

const styles = {
    root: {
        margin: '0px 0px 0px 0px',
        // textAlign: 'center',
    },
    // grid_container: {
    //     justify: 'center',
    // }
};

export class BreederInfoCard extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: '',
        };
    }

    render() {
        return (
            <ListItem alignItems="flex-start">
                <ListItemAvatar>
                    <Avatar variant='square' alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
                </ListItemAvatar>
                <ListItemText
                    primary="SnoValley Collies"
                    secondary={
                        <React.Fragment>
                            <Typography
                                component="span"
                                variant="body2"
                                // className={classes.inline}
                                color="textPrimary"
                            >
                                Ali Connors
                            </Typography>
                            {" Coming from only the purest and finest of bloodlines, we have carefully selected which dogs we breed. We are intentional …"}
                        </React.Fragment>
                    }
                />
            </ListItem>
            //   <Divider variant="inset" component="li" />
        );

    }
}

export default withStyles(styles)(BreederInfoCard);
